import { Link } from 'react-router-dom';
import Ticket from './../images/movie_tickets.jpg';

const Home = () => {
    return (

        <div clasName="text-center">
            <h2>Find a movie to watch tonight!</h2>
            <hr />
            <Link to="/movies">
            <img src={Ticket} alt="Movie Tickets" />
            </Link>
        </div>

    )
}

    export default Home;
